import React, {Component} from 'react';
import '../index.css'
import Book from './book';

class Nominations extends Component{
    render() {
        return (
            <div>
                <Book name = "Test" path = "https://images-na.ssl-images-amazon.com/images/I/71Ks+8mKq2L.jpg"/>
            </div>
        );
    }
}

export default Nominations;
